"use strict";

function initMultipleBar() {
  var e = document.getElementById("multipleBar");
  new Chart(e, {
    type: "bar",
    data: {
      labels: ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"],
      datasets: [{
        label: "Revenue",
        data: [22, 39, 30, 20, 25, 28, 22, 39, 30, 30, 25, 38],
        backgroundColor: "#015941"
      }, {
        label: "Expenses",
        data: [20, 35, 27, 18, 20, 25, 20, 35, 25, 28, 22, 35],
        backgroundColor: "#E1E3EA"
      }, {
        label: "Profit",
        data: [25, 30, 25, 22, 24, 22, 25, 30, 28, 32, 20, 30],
        backgroundColor: "#e49e3d"
      }]
    },
    options: {
      responsive: !0,
      barPercentage: .75,
      categoryPercentage: .5,
      maintainAspectRatio: !1,
      scales: {
        y: {
          grid: {
            display: !1
          },
          border: {
            display: !1
          },
          ticks: {
            stepSize: 15,
            color: "#6c757d",
            font: {
              family: "Outfit, sans-serif"
            }
          }
        },
        x: {
          grid: {
            display: !1
          },
          border: {
            display: !1
          },
          ticks: {
            color: "#6c757d",
            font: {
              family: "Outfit, sans-serif"
            }
          }
        }
      },
      elements: {
        bar: {
          borderRadius: 3
        }
      },
      plugins: {
        legend: {
          labels: {
            usePointStyle: !0,
            font: {
              color: "#6c757d",
              family: "Outfit, sans-serif"
            }
          }
        }
      }
    }
  });
}
